import React, { useEffect, useState } from "react";
import { auth, db } from "../firebase"; // Firebase imports
import { collection, onSnapshot, doc, deleteDoc, addDoc } from "firebase/firestore"; // Firestore methods
import { useNavigate } from "react-router-dom";
import userImage from "../assets/user.png";

const AdminDashboard = () => {
  const [pendingOrders, setPendingOrders] = useState([]);
  const [orderHistory, setOrderHistory] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    // Fetch orders in real-time
    const unsubscribe = onSnapshot(collection(db, "orders"), (snapshot) => {
      const orders = snapshot.docs.map((doc) => ({
        id: doc.id, // Store document ID for deletion
        ...doc.data(),
      }));
      setPendingOrders(orders);
    });

    // Clean up the listener when the component unmounts
    return () => unsubscribe();
  }, []);

  const handleLogout = () => {
    auth.signOut()
      .then(() => {
        navigate("/login");
      })
      .catch((error) => {
        console.error("Error logging out:", error.message);
        alert("Failed to log out. Please try again.");
      });
  };

  const handleCompleteOrder = async (order) => {
    try {
      // Move the order to "orderHistory" collection
      await addDoc(collection(db, "orderHistory"), order);

      // Delete the order from "orders" collection
      await deleteDoc(doc(db, "orders", order.id));

      alert("Order marked as complete!");
    } catch (error) {
      console.error("Error completing order:", error.message);
      alert("Failed to complete the order. Please try again.");
    }
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      {/* Ribbon Section */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          padding: "10px",
          backgroundColor: "#f0f0f0",
          border: "1px solid #ddd",
          borderRadius: "10px",
          marginBottom: "20px",
        }}
      >
        <div style={{ display: "flex", alignItems: "center" }}>
          <img
            src={userImage}
            alt="Admin"
            style={{
              height: "50px",
              width: "50px",
              borderRadius: "50%",
              marginRight: "10px",
            }}
          />
          <h2>Admin Dashboard</h2>
        </div>
        <button
          style={{ padding: "5px 10px", cursor: "pointer" }}
          onClick={handleLogout}
        >
          Logout
        </button>
      </div>

      {/* Pending Orders Section */}
      <div
        style={{
          margin: "20px",
          padding: "20px",
          border: "1px solid #ddd",
          borderRadius: "10px",
          backgroundColor: "#fafafa",
        }}
      >
        <h3>Pending Orders</h3>
        {pendingOrders.length === 0 ? (
          <p>No pending orders.</p>
        ) : (
          pendingOrders.map((order, index) => (
            <div
              key={order.id}
              style={{
                border: "1px solid #ccc",
                borderRadius: "8px",
                padding: "10px",
                marginBottom: "10px",
                textAlign: "left",
              }}
            >
              <h4>Table {order.tableNumber}</h4>
              <ul>
                {order.items.map((item, i) => (
                  <li key={i}>
                    {item.name} - ₹{item.price.toFixed(2)}
                  </li>
                ))}
              </ul>
              <h4>Total: ₹{order.total}</h4>
              <button
                onClick={() => handleCompleteOrder(order)}
                style={{
                  padding: "5px 10px",
                  cursor: "pointer",
                  backgroundColor: "#4CAF50",
                  color: "#fff",
                  border: "none",
                  borderRadius: "5px",
                }}
              >
                Mark as Complete
              </button>
            </div>
          ))
        )}
      </div>

      {/* Order History Section */}
      <div
        style={{
          margin: "20px",
          padding: "20px",
          border: "1px solid #ddd",
          borderRadius: "10px",
          backgroundColor: "#fafafa",
        }}
      >
        <h3>Order History</h3>
        {orderHistory.length === 0 ? (
          <p>No completed orders yet.</p>
        ) : (
          orderHistory.map((order, index) => (
            <div
              key={index}
              style={{
                border: "1px solid #ccc",
                borderRadius: "8px",
                padding: "10px",
                marginBottom: "10px",
                textAlign: "left",
              }}
            >
              <h4>Table {order.tableNumber}</h4>
              <ul>
                {order.items.map((item, i) => (
                  <li key={i}>
                    {item.name} - ₹{item.price.toFixed(2)}
                  </li>
                ))}
              </ul>
              <h4>Total: ₹{order.total}</h4>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
